import React, { Component } from "react";
import ArrowDownwardOutlinedIcon from "@mui/icons-material/ArrowDownwardOutlined";
import "./TrangChu.css";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from "recharts";
export default class TrangChu extends Component {
  render() {
    const data = [
      {
        name: "Page A",
        uv: 4000,
        pv: 2400,
        amt: 2400,
      },
      {
        name: "Page B",
        uv: 3000,
        pv: 1398,
        amt: 2210,
      },
      {
        name: "Page C",
        uv: 2000,
        pv: 9800,
        amt: 2290,
      },
    ];
    let demoUrl = "https://codesandbox.io/s/simple-line-chart-kec3v";
    return (
      <>
        <div className="container">
          <div className="tb">
            <h3>Revanua</h3>
            <div className="down">
              <span>1233$ - 2323$</span>
              <ArrowDownwardOutlinedIcon></ArrowDownwardOutlinedIcon>
            </div>
            <h3>Compared to last month</h3>
          </div>
          <div className="tb">
            <h3>Revanua</h3>
            <div className="down">
              <span>1233$ - 2323$</span>
              <ArrowDownwardOutlinedIcon></ArrowDownwardOutlinedIcon>
            </div>
            <h3>Compared to last month</h3>
          </div>
          <div className="tb">
            <h3>Revanua</h3>
            <div className="down">
              <span>1233$ - 2323$</span>
              <ArrowDownwardOutlinedIcon></ArrowDownwardOutlinedIcon>
            </div>
            <h3>Compared to last month</h3>
          </div>
        </div>
        <ResponsiveContainer width="100%" height="100%">
          <LineChart
            width={500}
            height={100}
            data={data}
            margin={{
              top: 5,
              right: 30,
              left: 20,
              bottom: 5,
            }}
          >
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
            <Legend />
            <Line
              type="monotone"
              dataKey="pv"
              stroke="#8884d8"
              activeDot={{ r: 8 }}
            />
            <Line type="monotone" dataKey="uv" stroke="#82ca9d" />
          </LineChart>
        </ResponsiveContainer>
      </>
    );
  }
}
